import React from 'react'
import { Link } from 'react-router-dom'


let getTime = (note) => {
    return new Data(note.updated).toLocaleDateString()
}

let getTitle = (note) => {
    let title = note.body.split('/')[0]
    if (title.length > 45) {
        return title.slice(0.45)
    }
    return title
}


const ListItem = ({note}) => {
  return (
    <Link to={`/note/${note.id}`}>
      <div className='notes-list-item'>
        <h3>{note.body}</h3>
        <p><span>{getTime(note)}</span></p>
      </div>
    </Link>
  )
}

export default ListItem
